import React, {useState, useEffect} from 'react';
import {
  Control,
  Input,
} from 'react-bulma-components/lib/components/form';
import '../App.css';

export const FilterButton = (props) => {
  return (
    <div>
      <Control>
        <Input onChange={props.onChange} name="bottle" type="bottle" placeholder="Bottle search" value={props.value} />
      </Control>
    </div>
  );
}
